import './App.css';

import { oauthURL } from 'config';

import Button from 'components/Button';

import React, { useEffect } from 'react';

function App() {

  useEffect();

  return (
    <div>
      <Button onClick={() => window.location = oauthURL}>Login with Spotify</Button>
    </div>
  );
}

export default App;
